The first Zion Caravan Tour has officially come to a close! We all made it safely back to Nashville this morning. 

Huge shoutout to this wonderful group of guys for pulling off 27 shows this fall (and 14 in the spring for most of them!). 

This is the dream team. Each one of them is incredibly talented, hard-working, and big-hearted. It took a whole lot of work to pull this whole thing together and I am so so thankful to each of them for keeping it all going (all roles listed below). 

I’ll always look back on the first Zion Caravan Tour as one of the most fun, meaningful, and fulfilling and seasons of my life.

Thanks so much  to everyone who came out to one of these shows. We sincerely hope you enjoyed it! We have lots of dreams for this group still to come! In a lot of ways, the Zion Caravan is just getting started. Stay tuned!

Shoutouts!

@lovknmusic - honored to have played so many shows with this guy. Can’t wait for the next one.

@antoinebmusic - Love this guy. Also love that we often end up talking about some super deep theological subject and dragon ball z in the same convo. 

@johnmarkpantana - so glad John Mark joined the tour. Couldn’t imagine this tour without him now. We laughed very hard many many times together. 

@markbarlow - wow. what a talent, and such a delightfully genuine and loving person. So glad to call him a friend. 

@gregdrumsandstuff - tour manager, front of house, absolute legend. Greg worked all the logistics and worked tirelessly to make every show happen. 

@mountainmouthmusic - Hitoshi not only played cello and bass for every show, but worked side by side with Greg to make sure each show went off smoothly. 

@joeyliechty - slayed on the electric guitar every show and ran all of the merch! Brought so much life to the tour.

@geoffrey_bruick - lighting director. He 10x’d the aesthetic and professional feel of the show by being in the road with us.

@_joshua_b - drums. Josh made everything sound way way better than we did just playing acoustically without percussion. He upped the energy and feel of the show so much.

Last but not least was our driver, Captain Bill. Amazing guy. Felt like part of our family. 

Til’ next time!
